import userStore from '../reducers/userStore';

export const setUserAction = (request) => {
  return async (dispatch) => {
    try {
      dispatch(
        userStore.setLoginError([
          { errorType: 'error', message: 'reger ergerg' },
        ])
      );
    } catch (error) {
      console.error('hi-808: ', error);
      return error;
    }
  };
};
